import "bootstrap/dist/css/bootstrap.min.css"
import { Nav_bar } from "./Components/Nav";
import './App.css'
import Banner from "./Components/Banner";
import ShowHeat from "./Components/ShowHeat";
import About from "./Components/About";

function App() {
  return (
    <div className="App">
        <Nav_bar />
        <Banner />
        <About />
        <ShowHeat />
    </div>
  );
}

export default App;
